import React from 'react';
import Enzyme, { shallow } from 'enzyme';
import Adapter from 'enzyme-adapter-react-15';
import configureStore from 'redux-mock-store';

import Drawings from '../../../src/components/pages/Drawings/Drawings';
import { valuesNames } from '../../../src/components/pages/Drawings/forms.config';

Enzyme.configure({ adapter: new Adapter() });

// frequently used variables
const userId = '9999999000';
const sourceId = 'acb0eaf2-d1df-4c7a-9382-619b31935f2b';

// storage setup in different configurations
const mockStore = configureStore();
const storeResource = {
  patientsDrawings: {
    '9999999000': [
      {
        [valuesNames.NAME]: '600kb image',
        [valuesNames.DATE_CREATED]: 1514213879065,
        [valuesNames.SOURCE]: 'qewdDB',
        [valuesNames.SOURCE_ID]: '9613a65c-8038-43ad-8764-ecf559554958',
        dateCreatedConvert: '25-Dec-2017',
      },
    ],
  },
};
const storeWithFormsError = mockStore(Object.assign({
  drawingsDetail: {
    '9999999000': {
      [valuesNames.AUTHOR]: 'bob.smith@gmail.com',
      [valuesNames.DATE_CREATED]: 1514215102229,
      [valuesNames.DRAWING]: 'data:image/png;base64,',
      [valuesNames.NAME]: '1test',
      [valuesNames.SOURCE]: 'qewdDB',
      [valuesNames.SOURCE_ID]: '773d48e6-6c97-4e28-9f36-8f4589cbfd62',
      [valuesNames.USER_ID]: 9999999000,
    },
  },
  form: {
    drawingsDetailFormSelector: {
      syncErrors: {
        [valuesNames.NAME]: 'You must enter a value.',
      },
    },
    drawingsCreateFormSelector: {
      syncErrors: {
        [valuesNames.NAME]: 'You must enter a value.',
      },
    },
  },
}, storeResource));
const storeWithFormState = mockStore(Object.assign({
  drawingsDetail: {
    '9999999000': {
      [valuesNames.AUTHOR]: 'bob.smith@gmail.com',
      [valuesNames.DATE_CREATED]: 1514215102229,
      [valuesNames.DRAWING]: 'data:image/png;base64,',
      [valuesNames.NAME]: '1test',
      [valuesNames.SOURCE]: 'qewdDB',
      [valuesNames.SOURCE_ID]: '773d48e6-6c97-4e28-9f36-8f4589cbfd62',
      [valuesNames.USER_ID]: 9999999000,
    },
  },
  form: {
    drawingsDetailFormSelector: {
      values: {
        name: 12,
        author: 'bob.smith@gmail.com',
      },
    },
    drawingsCreateFormSelector: {
      values: {
        author: 'bob.smith@gmail.com',
        sourceId: '',
        name: 'dhdh'
      },
    },
  },
}, storeResource));
const storeEmpty = mockStore(Object.assign({
  drawingsDetail: {
    '9999999000': {},
  },
}, storeResource));
const storeWithDetail = mockStore(Object.assign({
  drawingsDetail: {
    '9999999000': {
      [valuesNames.AUTHOR]: 'bob.smith@gmail.com',
      [valuesNames.DATE_CREATED]: 1514215102229,
      [valuesNames.DRAWING]: 'data:image/png;base64,',
      [valuesNames.NAME]: '1test',
      [valuesNames.SOURCE]: 'qewdDB',
      [valuesNames.SOURCE_ID]: '773d48e6-6c97-4e28-9f36-8f4589cbfd62',
      [valuesNames.USER_ID]: 9999999000,
    },
  },
}, storeResource));

// configure context for various tests
const generateNewContext = (oldContext, pathname) => {
  const newContext = Object.assign({}, oldContext);
  newContext.router = Object.assign({}, newContext.router);
  newContext.router.history = Object.assign({}, newContext.router.history);
  newContext.router.history.location = { pathname };
  return newContext;
};
const context = {
  router: {
    history: {
      replace: () => {},
      location: {
        pathname: `/patients/${userId}/drawings`,
      },
    },
    route: {
      match: {
        params: {
          sourceId,
          userId,
        },
      },
    },
  },
};
const contextCreate = generateNewContext(context, `/patients/${userId}/drawings/create`);
const contextDetail = generateNewContext(context, `/patients/${userId}/drawings/${sourceId}`);

// configuration of forms for testing methods
const formValuesEdit = {
  [valuesNames.AUTHOR]: 'bob.smith@gmail.com',
  [valuesNames.NAME]: 'fafafafa'
};
const formValuesCreate = {
  [valuesNames.AUTHOR]: 'bob.smith@gmail.com',
  [valuesNames.NAME]: 'fafafafa',
  [valuesNames.DRAWING]: 'data:image/png;base64,',
};
const match = {
  params: {
    userId,
  },
};

describe('Component <Drawings />', () => {
  it('should renders correctly with drawingsDetail and testing Detail Panel', () => {
    const component = shallow(
      <Drawings
        store={storeWithDetail}
        match={match}
      />, { context }).dive().dive().dive()
      .dive()
      .dive()
      .dive()
      .dive();

    // Testing component handleDetailDrawingsClick methods
    expect(component.find('PluginListHeader')).toHaveLength(1);
    expect(component.find('PluginMainPanel')).toHaveLength(1);
    expect(component.find('DrawingsDetail')).toHaveLength(0);
    expect(component.find('PluginCreate')).toHaveLength(0);

    component.instance().handleDetailDrawingsClick('065d85e3-3cd5-4604-bb94-5685fffb193d');
    const componentStateAfterMethod = component.state();
    component.setState({ isSecondPanel: true, isDetailPanelVisible: true, isBtnExpandVisible: true, isBtnCreateVisible: true, isCreatePanelVisible: false, openedPanel: 'drawing', editedPanel: {}, isLoading: true, expandedPanel: 'all' });
    const componentStateAfterSetState = component.state();

    expect(componentStateAfterMethod).toEqual(componentStateAfterSetState);
    expect(component.find('DrawingsDetail')).toHaveLength(1);
    expect(component.find('PluginCreate')).toHaveLength(0);
    expect(component).toMatchSnapshot();

    // Testing component handleShow methods
    expect(component.state().openedPanel).toEqual('drawing');
    component.instance().handleShow('drawingPanel');
    expect(component.state().openedPanel).toEqual('drawingPanel');
    component.instance().handleShow('drawing');
    expect(component.state().openedPanel).toEqual('drawing');

    // Testing component handleExpand methods
    expect(component.find('PluginListHeader')).toHaveLength(1);
    expect(component.find('PluginMainPanel')).toHaveLength(1);
    expect(component.state().openedPanel).toEqual('drawing');
    expect(component.state().expandedPanel).toEqual('all');
    component.instance().handleExpand('drawing', 'drawingsDetail');
    expect(component.state().openedPanel).toEqual('drawing');
    expect(component.state().expandedPanel).toEqual('drawing');
    component.setState({ openedPanel: 'drawing', expandedPanel: 'drawing' });
    expect(component.find('PluginListHeader')).toHaveLength(0);
    expect(component.find('PluginMainPanel')).toHaveLength(0);
    expect(component).toMatchSnapshot();

    component.setState({ openedPanel: 'drawing', expandedPanel: 'all' });

    component.instance().handleExpand('drawing', 'drawingsCreate');
    component.setState({ expandedPanel: 'all' });
    component.instance().handleExpand('drawing', 'drawingsMain');
    component.setState({ expandedPanel: 'test' });
    component.instance().handleExpand('drawing', 'drawingsMain');
    component.setState({ expandedPanel: 'test' });
    component.instance().handleExpand('drawing', 'drawingsCreate');

    // Testing component detail form methods
    expect(component.state().editedPanel).toEqual({});
    component.instance().handleEdit('drawing');
    expect(component.state().editedPanel).toEqual({ drawing: true });
    component.instance().handleDrawingDetailCancel('drawing');
    expect(component.state().editedPanel).toEqual({ drawing: false });
    component.instance().handleEdit('drawing');
    component.instance().handleSaveSettingsDetailForm(formValuesEdit, 'drawing');
    expect(component.state().editedPanel).toEqual({ drawing: false });
    component.instance().handleSaveSettingsDetailForm(formValuesEdit, 'drawingPanel');
    component.instance().handleDrawingDetailCancel('drawingPanel');

    expect(component).toMatchSnapshot();
  });

  it('should renders correctly with drawingsDetail and testing Create Panel', () => {
    const component = shallow(
      <Drawings
        store={storeWithDetail}
        match={match}
      />, { context }).dive().dive().dive()
      .dive()
      .dive()
      .dive()
      .dive();

    expect(component.find('PluginListHeader')).toHaveLength(1);
    expect(component.find('PluginMainPanel')).toHaveLength(1);
    expect(component.find('DrawingsDetail')).toHaveLength(0);
    expect(component.find('PluginCreate')).toHaveLength(0);

    // Testing component create panel methods
    component.instance().handleCreate();
    const componentStateAfterMethod = component.state();
    component.setState({ isBtnCreateVisible: false, isCreatePanelVisible: true, openedPanel: 'drawingsCreate', isSecondPanel: true, isDetailPanelVisible: false, isLoading: true, isBtnExpandVisible: false, expandedPanel: 'all', isSubmit: false })
    const componentStateAfterSetState = component.state();
    expect(componentStateAfterMethod).toEqual(componentStateAfterSetState);
    expect(component.find('PluginCreate')).toHaveLength(1);
    expect(component).toMatchSnapshot();
    component.instance().handleCreateCancel();
    component.instance().handleSaveSettingsCreateForm(formValuesCreate);

    component.setState({ drawingImage: 'test' });
    component.instance().handleSaveSettingsDetailForm(formValuesEdit, 'drawing');
    component.instance().handleSaveSettingsCreateForm(formValuesCreate);

    expect(component).toMatchSnapshot();
  });

  it('should renders correctly and testing another methods', () => {
    const component = shallow(
      <Drawings
        store={storeWithDetail}
        match={match}
      />, { context }).dive().dive().dive()
      .dive()
      .dive()
      .dive()
      .dive();

    // Testing component hideCreateForm methods
    component.instance().hideCreateForm();
    expect(component.state().isBtnCreateVisible).toEqual(true);
    expect(component.state().isCreatePanelVisible).toEqual(false);
    expect(component.state().openedPanel).toEqual('drawing');
    expect(component.state().isSecondPanel).toEqual(false);
    expect(component.state().expandedPanel).toEqual('all');
    expect(component.state().isBtnExpandVisible).toEqual(false);

    // Testing component handleFilterChange methods
    expect(component.state().nameShouldInclude).toEqual('');
    component.instance().handleFilterChange({ target: { value: 'test' } });
    expect(component.state().nameShouldInclude).toEqual('test');
    component.instance().handleFilterChange({ target: { value: '' } });
    expect(component.state().nameShouldInclude).toEqual('');

    // Testing component handleHeaderCellClick methods
    expect(component.state().columnNameSortBy).toEqual('name');
    expect(component.state().sortingOrder).toEqual('asc');
    component.instance().handleHeaderCellClick({}, { name: 'dateCreated', sortingOrder: 'desc' });
    expect(component.state().columnNameSortBy).toEqual('dateCreated');
    expect(component.state().sortingOrder).toEqual('desc');

    // Testing component handleSetOffset methods
    expect(component.state().offset).toEqual(0);
    component.instance().handleSetOffset(10);
    expect(component.state().offset).toEqual(10);

    // Testing component onChangeImageCanvas methods
    component.instance().onChangeImageCanvas('test');
    expect(component.state().drawingImage).toEqual('test');

    expect(component).toMatchSnapshot();
  });

  it('should renders correctly and testing context and lifecycle componentWillReceiveProps', () => {
    const component = shallow(
      <Drawings
        store={storeWithDetail}
        match={match}
      />, { context }).dive().dive().dive()
      .dive()
      .dive()
      .dive()
      .dive();

    component.setProps({ test: 'testing context' });
    component.setContext(contextCreate);
    component.setProps({ test: 'testing create context' });
    component.setContext(contextDetail);
    component.setProps({ test: 'testing edit context' });

    expect(component).toMatchSnapshot();
  });

  it('should renders correctly with forms error', () => {
    const component = shallow(
      <Drawings
        store={storeWithFormsError}
        match={match}
      />, { context }).dive().dive().dive()
      .dive()
      .dive()
      .dive()
      .dive();

    component.instance().handleSaveSettingsDetailForm(formValuesEdit, 'drawing');
    component.instance().handleSaveSettingsCreateForm(formValuesCreate);

    expect(component).toMatchSnapshot();
  });

  it('should renders correctly with empty store', () => {
    const component = shallow(
      <Drawings
        store={storeEmpty}
        match={match}
      />, { context }).dive().dive().dive()
      .dive()
      .dive()
      .dive()
      .dive();

    expect(component).toMatchSnapshot();
  });

  it('should renders correctly with storeWithFormState', () => {
    const component = shallow(
      <Drawings
        store={storeWithFormState}
        match={match}
      />, { context }).dive().dive().dive()
      .dive()
      .dive()
      .dive()
      .dive();

    component.instance().handleSaveSettingsDetailForm(formValuesEdit);
    component.setState({ drawingImage: 'test' });
    component.instance().handleSaveSettingsDetailForm(formValuesEdit);
    component.instance().handleSaveSettingsCreateForm(formValuesCreate);

    expect(component).toMatchSnapshot();
  });
});
